# These functions provide functionality to set random seeds, rotate images, and read and process images for further analysis.

def seed_everything(seed=42):
	np.random.seed(seed)
	os.environ['PYTHONHASHSEED']=str(seed)
	os.environ["CUBLAS_WORKSPACE_CONFIG"]=":4096:8" # added so that Colab can run GPU for given Model Configuration
	np.random.seed(seed)
	torch.manual_seed(seed)

def rotate_image(image, angle):
  image_center = tuple(np.array(image.shape[1::-1]) / 2)
  rot_mat = cv2.getRotationMatrix2D(image_center, angle, 1.0)
  result = cv2.warpAffine(image, rot_mat, image.shape[1::-1], flags=cv2.INTER_LINEAR)
  return result

def read_images(file_name, img_width, img_height, title="", suffix="", transform=False):
  i = 0
  print('-' * 50)
  print(title, '- Reading Images...')
  print('-' * 50)
  j = 0
  cntr = 0
  mul = 1
  if transform:
    mul = 7
  total = len(file_name)

  channel = 3
  if 'Annotation' in suffix:
    channel = 1
  X_train = torch.tensor(np.ndarray((mul * total, channel, img_width, img_height), dtype=np.uint8))

  for label in file_name:
      file_path = label + suffix
      print("Reading:", file_path)
      img = cv2.imread(file_path, cv2.IMREAD_COLOR)
      if img is None:
          print("Error: Could not read image:", file_path)
          continue

      if channel == 1:
        image = cv2.imread(file_path, 0)
        if image is None:
            print("Error: Could not read annotation image:", file_path)
            continue

        im = image.copy()
        im = cv2.cvtColor(im, cv2.COLOR_GRAY2BGR)
        contours, hierarchy = cv2.findContours(image, cv2.RETR_TREE, cv2.CHAIN_APPROX_SIMPLE)

        for c in contours:
            ellipse = cv2.fitEllipse(c)
            cv2.ellipse(im, ellipse, (255, 255, 255), -1)
        img = cv2.cvtColor(im, cv2.COLOR_BGR2GRAY)

      # Rest of the code...


      # Resize Images
      scale_width = img.shape[0] / img_width
      if img.shape[1] / img_height > scale_width:
        scale_width = img.shape[1] / img_height
      img = cv2.resize(img, (int(img.shape[1] / scale_width), int(img.shape[0] / scale_width)))

      # Center Image
      top = int((img_height - img.shape[1]) / 2)
      bottom = img_height - img.shape[1] - top
      left = int((img_width - img.shape[0]) / 2)
      right = img_width - img.shape[0] - left
      img = cv2.copyMakeBorder(img, left, right, top, bottom, borderType=cv2.BORDER_CONSTANT, value=(0, 0, 0, 0))

      # transform Image
      if transform:
        base_img = []
        base_img.append(img)
        base_img.append(rotate_image(img, 30))
        base_img.append(rotate_image(img, 60))
        if '_Annotation' not in suffix:
          base_img.append(cv2.blur(np.array(img), (10, 10)))
        else:
          base_img.append(img)
        base_img.append(cv2.flip(np.array(img), 0))
        base_img.append(cv2.flip(np.array(img), 1))
        base_img.append(cv2.flip(np.array(img), -1))
        for m in range(0, 7):
          img = base_img[m]
          # Convert to n,c,w,h
          image = torch.from_numpy(img)
          image = image[np.newaxis, :]
          if channel == 3:
            image = image.permute(0, 3, 1, 2)
          X_train[j + m] = image
        j += 4
      else:
        image = torch.from_numpy(img)
        image = image[np.newaxis, :]
        if channel == 3:
          image = image.permute(0, 3, 1, 2)
        X_train[j] = image
        j += 1

      if cntr % 100 == 0:
          print('Read: {0}/{1} images'.format(cntr, total))
      cntr += 1

  print(title, ' - Reading Completed')
  return X_train

